INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24001, 24, 0.0, 102601, 1, "あたしだって\nやるときはやるよ！", 0, 0.0, 0.0, "2030/12/17 14:59:59", "リン", 10040, 1, "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24002, 24, 0.0, 102601, 1, "ふぅ…\nこれであたしの仕事は\n終わりだね", 1, 0.0, 0.0, "2030/12/17 14:59:59", "リン", 10040, 1, "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24003, 24, 0.0, 102601, 1, "終わった終わった\n一人でもなんとか\nなるもんだね", 2, 0.0, 0.0, "2030/12/17 14:59:59", "リン", 10040, 1, "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24004, 24, 0.0, 102601, 2, "やったね！\nこれでようやく\nサボれるよ…", 3, 0.0, 0.0, "2030/12/17 14:59:59", "リン", 10040, 2, "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24005, 24, 0.0, 102601, 1, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 4, 0.0, 0.0, "2030/12/17 14:59:59", "リン", 10040, 1, "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24006, 24, 0.0, 102601, 2, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 5, 0.0, 0.0, "2030/12/17 14:59:59", "リン", 10040, 2, "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24007, 24, 0.0, 102601, 2, "あたしも意外と\nやるもんでしょ？", 6, 0.0, 0.0, "2030/12/17 14:59:59", "リン", 10040, 2, "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24008, 24, 0.0, 102601, 4, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 7, 0.0, 0.0, "2030/12/17 14:59:59", "リン", 10040, 4, "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24009, 24, 0.0, 102601, 4, "このままじゃ\nまっひ～に\n叱られちゃうよ", 8, 0.0, 0.0, "2030/12/17 14:59:59", "リン", 10040, 4, "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24010, 24, 0.0, 102601, 4, "まじめに\nやったんだけどな…\n悔しいな～", 9, 0.0, 0.0, "2030/12/17 14:59:59", "リン", 10040, 4, "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24011, 24, 0.0, 102601, 4, "やられた…\nねずみって意外と\nてごわいね", 10, 0.0, 0.0, "2030/12/17 14:59:59", "リン", 10040, 4, "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24012, 24, 0.0, 102601, 4, "おのれ～\nあたしのチーズを\n盗みやがって～！", 11, 0.0, 0.0, "2030/12/17 14:59:59", "リン", 10040, 4, "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24013, 24, 0.0, 102601, 1, "疲れた…\nけど、次こそは\n守り抜くよ…", 12, 1.81, 0.0, "2030/12/17 14:59:59", "リン", 10040, 4, "2020/04/30 12:00:00");
